import React from 'react';
import { RidingData, FishingData } from './data'; // Adjust the import path as needed
import HobbyItem from './HobbyItem';

const App = () => {
  return (
    <div>
      {FishingData.map((item, index) => (
        <HobbyItem
          key={index}
          title={item.title}
          desc={item.desc}
          hashes={item.hashes}
          link={item.link}
          thumbnail={item.thumbnail}
        />
      ))}
      {FishingData.map((item, index) => (
        <HobbyItem
          key={index}
          title={item.title}
          desc={item.desc}
          hashes={item.hashes}
          link={item.link}
          thumbnail={item.thumbnail}
        />
      ))}
    </div>
  );
};

export default App;
